// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.8.0;
import "./ElectionOrganizer.sol";

contract Authentication {
    /*
        This contract would be to register users on the app.
        Essentially it authenticates a public address to be an election organizer, who can:
            -> who can initiate elections
            -> see election statistics            
    */

    // Tells if a user is authenticated or not;

//----------
    uint public userId = 0;

    struct UserAuth {
        string name;
        address publicAddress;
    }
    mapping(uint256 => UserAuth) public Users;
//----------

    mapping(address => bool) userAuthStatus;

    function getAuthStatus(address _user) public view returns (bool) {
        return userAuthStatus[_user]; //change to msg.sender
    }
//----------
    function createUser(string memory name) public {
        require(getAuthStatus(msg.sender) == false, "User already registered");
        userAuthStatus[msg.sender]=true;
        Users[userId] = UserAuth( name ,msg.sender);
        userId++;
    }
}
//-------------

contracts/ElectionOrganizer.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.8.0;
import './Election.sol';
import './ballot/Ballot.sol';
import './ElectionStorage.sol';

contract ElectionOrganizer {
    
    struct OrganizerInfo{
        uint organizerID;
        string name;
        address publicAddress;
    }
    //-------------
    address[] elections;
    //-------------
    mapping(address => OrganizerInfo)organizers;

    event CreatedElection(address election);
    event CandidateAdded(address election, Election.Candidate candidate);

    function addOrganizer(OrganizerInfo memory _organizerInfo, address _organizer) public {
        organizers[_organizer] = _organizerInfo;
    }

    function createElection(Election.ElectionInfo memory _electionInfo,Ballot _ballot, ResultCalculator _resultCalculator)public{
   
        Election election = new Election(_electionInfo,_ballot,_resultCalculator,msg.sender);
        elections.push(address(election));
        emit CreatedElection(address(election));
        // save in ElectionStorage
    }
    //----------
    function getElections() public view returns(address[] memory){
        return elections;
    }
    //-----------
    function addCandidate(Election _election,Election.Candidate memory _candidate)public{
        _election.addCandidate(_candidate);
        emit CandidateAdded(address(_election),_candidate);
    }
    
    function getResult(Election _election)public{
        _election.getResult();
        // emit ResultsDeclared(address(_election),_election.getWinners());
    }
    
}

contracts/Election.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.8.0;

import './ballot/Ballot.sol';
import './resultCalculator/ResultCalculator.sol';


contract Election {

    struct ElectionInfo {
        uint electionID;
        string name;
        string description;
        uint startDate;
        uint endDate;
        // Election type: 0 for invite based 1 for open
        // bool electionType;
    }
    ElectionInfo public electionInfo;

    struct Candidate {
        uint candidateID;
        string name;
    }
    Candidate[] candidates;
    Candidate[] winners;

    uint[] candidateIDs;
    uint[] winnerIDs;

    mapping(uint=>Candidate)candidateMap;

    address electionOrganizer;

    uint voterCount;


    enum Status {
        active,
        pending,
        closed
    }
    Status status;
    
    //Dependencies
    Ballot public ballot;
    ResultCalculator public resultCalculator;

    //Events
    event CandidateAdded(address election, address ballot, Candidate candidate);
    event VoteCasted(address ballot, Candidate candidate, uint weight);
    event ListWinners(Candidate[] winners);

    //Modifiers
    modifier onlyOrganizer() {
        require(msg.sender == electionOrganizer,"Caller must be the election organizer");
        _;
    }    

    //Constructor
    constructor(ElectionInfo memory _electionInfo, Ballot _ballot, ResultCalculator _resultCalculator,address _electionOrganizer){
        
        electionOrganizer = _electionOrganizer;
        electionInfo = _electionInfo;
        ballot = _ballot;
        resultCalculator = _resultCalculator;
        if(block.timestamp < _electionInfo.startDate) {
            status = Status.pending;
        } else {
            status = Status.active;
        }
        voterCount = 0;

    }

    function getStatus()public view returns (Status){

        if(block.timestamp < electionInfo.startDate) {
            return Status.pending;
        } 
        
        else if(block.timestamp < electionInfo.endDate) {
            return Status.active;
        } 
        
        else {
            return Status.closed;
        }
    }

    // Authentication
    // function isAuthenticated(Voter _voter) public returns(bool){}


    function getElectionInfo() public view returns(ElectionInfo memory){
        return electionInfo;
    }
    
    //Add candidate to election as well as ballot
    function addCandidate(Candidate memory _candidate) onlyOrganizer public {
        candidates.push(_candidate);
        ballot.addCandidate(_candidate.candidateID);
        candidateMap[_candidate.candidateID]=_candidate;
        candidateIDs.push(_candidate.candidateID);
        emit CandidateAdded(address(this),address(ballot),_candidate);
    }
    
    function getCandidates() public view returns (Candidate[] memory){
        return candidates;
    }

    function getVoterCount() public view returns(uint){
        return voterCount;
    }

    function getVoteStatus(address _voter) public view returns(bool){
        return ballot.getVoteStatus(_voter);
    }

    // only after election ends
    function getWinners()onlyOrganizer public view returns(uint[] memory){
        return winnerIDs;
    }
    
    // Performs vote in ballot and updates voterCount
    /*
        In invite based elections, a condidition to check if voter is authenticated

    */
    function vote(address _voter, uint _candidateID, uint weight) public {
        // if (electionInfo.electionType==0) {
        //     require(isAuthenticated(msg.Sender),"Voter must be authenticated to cast vote");
        // }
        ballot.vote(_voter,_candidateID, weight);
        voterCount++;
        emit VoteCasted(address(ballot),candidateMap[_candidateID],weight);
    }

    // function getTimeStamps()public;
    //                  ->this can be depracated, since time stamps are easily available from ElectionInfo
    

    function getResult() onlyOrganizer public {
        winnerIDs = resultCalculator.getResult(ballot, voterCount);
        for(uint i=0; i<candidates.length; i++){
            winners.push(candidateMap[winnerIDs[i]]);
        }
        emit ListWinners(winners);
    }

}

contracts/ballot/Ballot.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.8.0;
import '../Election.sol';
import '../resultCalculator/ResultCalculator.sol';

abstract contract Ballot {
    
    uint[] candidates;

    mapping(address=>bool)voteStatus;

    function addCandidate(uint _candidate)public {
        candidates.push(_candidate);
    }

    function getCandidates()public view returns(uint[] memory){
        return candidates;
    }

    function getVoteStatus(address _voter) public view returns(bool) {
        return voteStatus[_voter];
    }

    function vote(address _voter, uint _candidate, uint _weight)public virtual;
    
    /*
    Here the weight resembles the preference for preferential voting, in which case the function returns 
    the votes of a candidate in a particular preference.

    Else it just returns the vote count or score count.
    */
    function getVoteCount(uint _candidate, uint _weight)public virtual view returns(uint);

}

